import styled from "@emotion/styled";

export const SubTitleEl = styled.h4`
  width: 100%;
  border-bottom: 1px solid #000;
  padding-bottom: 0.6em;
  font-weight: normal;
  font-size: 1.5em;
  @media only screen and (max-width: 600px) {
    font-size: 1em;
  }
`;
